(function () {
    'use strict';

    angular
        .module('app')
        .controller('AttendenceListController', AttendenceListController);

    AttendenceListController.$inject = ["$scope", "adminService", "loadDataService", "Factory"];

    function AttendenceListController($scope, adminService, loadDataService, Factory) {
        $scope.checkSysytemLogin();
        $scope.currentPage = 1;
        $scope.sizeOptions = Factory.SizeOptions;
        $scope.pageSize = $scope.sizeOptions[1];
        $scope.sort = function (key) {
            $scope.sortKey = key;
            $scope.reverse = !$scope.reverse;
        };

        //$scope.getPDF = function () {
        //    window.open("data:application/pdf;base64,");
        //};

        ////$scope.getPDF = function () {
        ////    var arrrayBuffer = '';
        ////    var blob = new Blob([arrrayBuffer], { type: "application/pdf" });
        ////    var link = window.URL.createObjectURL(blob);
        ////    window.open(link, '', 'height=650,width=840');
        ////}
        //$scope.getPDF();

        $scope.getShiftList = function () {
            $scope.dataLoading = true;
            adminService.getShiftList(1)
                .then(function (response) {
                    if (response.data.Message == 'Success') {
                        $scope.ShiftList = response.data.ShiftList;
                    } else {
                        toastr.error(response.data.Message);
                    }
                    $scope.dataLoading = false;
                }, function (err) {
                    toastr.error("Some error occured while fetching data");
                    $scope.dataLoading = false;
                })
        }
        $scope.getShiftList();

        $scope.getStaffGroupList = function () {
            $scope.dataLoading = true;
            adminService.getStaffGroupList(1)
                .then(function (response) {
                    if (response.data.Message == 'Success') {
                        $scope.StaffGroupList = response.data.StaffGroupList;
                    } else {
                        toastr.error(response.data.Message);
                    }
                    $scope.dataLoading = false;
                }, function (err) {
                    toastr.error("Some error occured while fetching data");
                    $scope.dataLoading = false;
                })
        }
        $scope.getStaffGroupList();

        $scope.getStaffList = function () {
            $scope.dataLoading = true;
            adminService.getSearchStaffList(1, 0)
                .then(function (response) {
                    if (response.data.Message == 'Success') {
                        $scope.StaffList = response.data.StaffList;
                    } else {
                        toastr.error(response.data.Message);
                    }
                    $scope.dataLoading = false;
                }, function (err) {
                    toastr.error("Some error occured while fetching data");
                    $scope.dataLoading = false;
                })
        }
        $scope.getStaffList();

        $scope.getAttendenceList = function () {
            $scope.dataLoading = true;
            var fileterModel = {
                Id: $scope.AttendenceCode,
                FromDate: loadDataService.getDateTime($scope.FromDate),
                ToDate: loadDataService.getDateTime($scope.ToDate),
                StaffGroupId: $scope.StaffGroupId,
                ShiftId: $scope.ShiftId,
            }
            adminService.getAttendenceList(fileterModel)
                .then(function (response) {
                    if (response.data.Message == 'Success') {
                        console.log(response.data);
                        $scope.AttendenceList = response.data.AttendenceList;
                    } else {
                        toastr.error(response.data.Message);
                    }
                    $scope.dataLoading = false;
                }, function (err) {
                    toastr.error("Some error occured while fetching data");
                    $scope.dataLoading = false;
                })
        }

        $scope.afterStaffSelected = function (selected) {
            if (selected != undefined) {
                $scope.AttendenceCode = selected.originalObject.AttendenceCode;
            } else {
                $scope.AttendenceCode = null;
            }
        }

        $scope.changeReportNo = function () {
            $scope.ShiftId = null;
            $scope.StaffGroupId = null;
            $scope.AttendenceCode = null;
        }

        $scope.printReport = function (no) {
            if (no == 1) {
                if ($scope.ShiftId == null || $scope.ShiftId == undefined) {
                    toastr.error("Shift is required");
                    return;
                }
            } else if (no == 2) {
                if ($scope.StaffGroupId == null || $scope.StaffGroupId == undefined) {
                    toastr.error("Group is required");
                    return;
                }
            } else if (no == 3) {
                if ($scope.AttendenceCode == null || $scope.AttendenceCode == undefined) {
                    toastr.error("Staff is required");
                    return;
                }
            } else {
                if ($scope.AttendenceCode == null || $scope.AttendenceCode == undefined) {
                    toastr.error("Report is required!!");
                    return;
                }
            }
            var fromDate = loadDataService.getDateDDMMYYYY($scope.FromDate);
            if (fromDate == null)
                fromDate = '';
            var toDate = loadDataService.getDateDDMMYYYY($scope.ToDate);
            if (toDate == null)
                toDate = '';
            var AttendenceCode = '';
            if ($scope.AttendenceCode)
                AttendenceCode = $scope.AttendenceCode;
            window.open('/print/AttendanceReportShiftwise?fromDate=' + fromDate + '&toData=' + toDate + '&shiftId=' + ($scope.ShiftId ? $scope.ShiftId : 0)+ '&groupId=' + ($scope.StaffGroupId ? $scope.StaffGroupId : 0) + '&code=' + AttendenceCode + '&no=' + no)
        }


        $scope.tablesToExcel = function (tables, wsnames, wbname, appname) {
            var initailPage = $scope.pageSize;
            $scope.pageSize = $scope.sizeOptions[$scope.sizeOptions.length - 1];
            $scope.IsExporting = true;
            setTimeout(function () {
                tablesToExcel(tables, wsnames, wbname, appname);
            }, 500)
            setTimeout(function () {
                $scope.IsExporting = false;
                $scope.pageSize = initailPage;
                $scope.$apply();
            }, 1000)
        }
    }
})();
